# Função para processar os dados de entrada
def process_input_data(data):
    paths = []
    lines = data.strip().split("\n")
    
    # Iterando sobre cada linha para pegar o Path e os pontos
    current_path = None
    for line in lines:
        if line.startswith("Path"):
            # Extrair o número do path
            path_number = int(line.split()[1])
            if current_path:
                paths.append(current_path)  # Adiciona o path anterior
            
            current_path = {"path": path_number, "points": []}  # Começar um novo path
        else:
            # Pegar os pontos extraídos
            points = list(map(float, line.strip()[1:-1].split(", ")))  # Converte para lista de floats
            current_path["points"] = points  # Adiciona os pontos ao path atual
    
    if current_path:
        paths.append(current_path)  # Adiciona o último path
    
    # Convertendo para o formato JSON
    return json.dumps(paths, indent=4)

# Processando os dados e retornando o JSON como string
